import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六己日戊辰时断</p><p>六己日生时戊辰，其身得位遇财神；田园富贵多诚信，甲乙提纲禄贵人。</p><p>己日戊辰时，财库专位。</p><p>已以壬癸为财，辰上入墓，己土专位。</p><p>为人诚信富贵。</p><p>若通月气或甲乙透出，是生月带禄、大贵。</p><p>辰月，身旺，不得父母力。</p><p>见甲化土者，大富。</p><p>冬夏，财旺生官、富贵。</p><p>西运，平常。</p><p>己丑日戊辰时，身孤。</p><p>寅卯月，禄旺。</p><p>辰月透甲，作化气看，贵。</p><p>午，富厚。</p><p>寅酉，风宪。</p><p>年月子丑透甲，行东南运，金紫，近侍；怕西北运，退职。</p><p>己卯日戊辰时，卯月，风宪。</p><p>水木年月，行东北运，并同。</p><p>己巳日戊辰时，身孤后发。</p><p>春官贵；夏平稳；秋凶暴；冬财旺。</p><p>岁运同。</p><p>己未日戊辰时，丑月，杂气财官，吉。</p><p>寅辰巳亥午戌年月，文章贵显。</p><p>己酉日戊辰时，春官旺，夏平吉，秋暴狠，冬财旺。</p><p>己亥日戊辰时，丑月，杂气财官，贵。</p><p>戌月，木水运，六、七品。</p><p>寅午子辰年月，大贵。</p><p>辰时己日不寻常，内有钱龙镇库藏；比劫不逢行运吉，定教富贵广田庄。</p><p>己日戊辰时遇，身逢旺库丰盈。</p><p>果然花谢再重荣，丑戌刑冲财盛。</p><p>壬申财官双美，妻重子晚方成。</p><p>双亲雁侣事中平，独立自成之命。</p>",32),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","231卷 九·六己日戊辰时断.html.vue"]]);export{f as default};
